import { useState } from 'react';
import logo from './chimp.jpg';
import './App.css';
import Tablausuario from './Componentes/Tablausuario';


function App() {
  

  return (
   
   <div className="App">
      <div className="titulo">
      <img src={logo} className="App-logo" alt="logo" />
      </div>
      <div className="App-header">
        </div>
        <div className="logo">
        </div>
        <Tablausuario/>
        </div>
        
  )
}

export default App;
